import { css } from '@emotion/react';
import * as React from 'react';
import Button from '../../../packages/faddy-design-system/components/Button/Button.js';

// 이미지 컴포넌트
const Image = ({ srcSet }) => (
  <img
    loading="lazy"
    srcSet={srcSet}
    css={imgStyle}
  />
);

// 버튼 컴포넌트
const StyledButton = ({ children, style }) => (
  <div css={style}>{children}</div>
);

// 메인 컴포넌트
function OnTheBoard(props) {
  return (
    <div css={boxStyle}>
      <div css={divStyle}>
        <Image srcSet="..." />
        <div css={div2Style}>Faddy</div>
        <div css={div3Style}>
          <div css={div4Style}>
            자신의 패션을 자유롭게
            <br />
            공유 하세요.
          </div>
          <StyledButton style={div5Style}>메인으로</StyledButton>
          <StyledButton style={div6Style}>로그인</StyledButton>
          <div css={div7Style}>
            By continuing, you agree to the{" "}
            <span style={{fontWeight: 600}}>Terms of Service</span> and
            confirm
            <br />
            that you have read our{" "}
            <span style={{fontWeight: 600}}>Privacy Policy</span>.
          </div>
        </div>
      </div>
    </div>
  );
}

export default OnTheBoard;
